app.register({baseUi:{initevents:function(){$(document).on("templates.registered",function(){app.core.ui.applyTemplate("navbar")})},registerTemplates:function(){app.core.ui.addTemplate("app","navbar","js/modules/baseUi/views/navbar.html"),app.core.ui.addTemplate("content","settings","js/modules/baseUi/views/settings.html")},openModal:function(e,a){app.core.ctrl.render(e,a,!1).then(function(){$(".modal").modal({dismissible:!0,opacity:.5,inDuration:300,outDuration:200,startingTop:"4%",endingTop:"10%"}).modal("open")})},closeModal:function(){$(".modal").modal("close")}}});